pragma solidity >=0.8 <0.9.0;
import "./GamblingPool.sol";


contract Players {
  struct Player {
    address wallet;
    string  name;
    uint    betSize;
  }

  Player[] private players;

  function getPlayers() public view returns (Player[] memory _players) {
    return players;
  }

  function addPlayer(address _wallet, string memory _name, uint _betSize) internal  {
    players.push(Player(_wallet, _name, _betSize));
  }
}
